class BioIdentificationService {
  static final BioIdentificationService _instance = BioIdentificationService._init();
  static BioIdentificationService get instance => _instance;
  Future<BioIdentificationModel> postBioIdentification(String image,String seriyes,String seriyesNumber,String birthDate) async {
    var _data = {
  "birth_date": birthDate,
  "doc_number": seriyesNumber,
  "doc_series": seriyes.toUpperCase(),
  
  "doc_type": 1,
  "photo": {
    "front": "data:image/png;base64," + image
  }
};
var data = {
  "birth_date": "1996-03-03",
  "doc_number": "3339379",
  "doc_series": "AA",
  "doc_type": 1,
  "photo": {
    "front": "data:image/jpeg;base64,"
  }
};
 
 try {
      final response = await DioClient.instance.post(
        '${Endpoints.baseUrl}${Endpoints.bioIdentification}',
        data: _data,
        options: Options(
          headers: Endpoints.headers(),
        )
      ); 
      return BioIdentificationModel.fromJson(response);
    } catch (e) {
      
      throw e;
    }
  }
  BioIdentificationService._init();
}
